function Canvas(w, h) {
	var canvas = document.getElementById("game");
	canvas.width = w;
	canvas.height = h;
	return { canvas : canvas, context: canvas.getContext("2d") };
}

var Renderer = function(canvas, map) {
	var colors = [
		"blue",
		"green",
		"yellow",
		"gray",
		"red"
	];
	var renderer = {
		draw: function() {
			for(var x = 0; x < map.length; x++) {
				for(var y = 0; y < map[0].length; y++) {
					canvas.context.fillStyle =  colors[map[x][y]];
					canvas.context.fillRect(x * 4, y * 4, 4, 4);
				}
			}
		}
	};

	return renderer;
};

